import {React, useState} from 'react';
import {Text, View, Button} from 'react-native'

const loginScreen = () => {
const [myCounter, useCounter] = useState(0);

return (
    <View>
        <Button 
        onPress={() => useCounter(myCounter+1)}
        title="Increse"
        />
        <Button 
        onPress={() => useCounter(myCounter-1)}
        title="Decrease"
        />
        <Text>Counter - {myCounter}</Text>
    </View>
)
}

export default loginScreen;
